window.bookSummaryJSON = "<p>Experience the smells, sounds, textures, signs, and tastes of the kitchen as a daughter lovingly prepares squash stew for her family on a brisk fall day.&nbsp;</p> <p>Bedtime stories are narrated by the world’s most celebrated voices and written with no beginning, middle, or end so you don’t stay up to hear what happens next. They're interesting enough to give your mind something to focus on but delivered in a way that encourages sleep.&nbsp;</p> <p>This title is part of the Audible Sleep Collection, exclusive audio experiences created to invite relaxation and sleep. New and free for members.</p>"; 
